import React, { useState } from "react";
import { motion } from "framer-motion";

export default function App() {
  const [url, setUrl] = useState("");
  const [loading, setLoading] = useState(false);
  const [msg, setMsg] = useState("");

  const handleDownload = async (e) => {
    e.preventDefault();
    if (!url.trim()) {
      setMsg("Please enter a YouTube URL.");
      return;
    }
    setMsg("");
    setLoading(true);

    try {
      const res = await fetch(`/api/stream?url=${encodeURIComponent(url)}`);
      if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);

      const blob = await res.blob();
      const disposition = res.headers.get("content-disposition") || "";
      const match = /filename="?([^"]+)"?/.exec(disposition);
      const filename = match && match[1] ? match[1] : "video.mp4";

      const a = document.createElement("a");
      a.href = URL.createObjectURL(blob);
      a.download = filename;
      document.body.appendChild(a);
      a.click();
      a.remove();
      URL.revokeObjectURL(a.href);
      setMsg("Download started ‚úîÔ∏è");
    } catch (err) {
      console.error(err);
      setMsg("Download failed ‚Äî check the URL and backend connection.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center p-6 bg-gradient-to-br from-black via-[#050505] to-[#111] relative overflow-hidden font-sans">
      {/* Neon gradient animated background */}
      <div className="absolute inset-0 overflow-hidden">
        <div className="absolute w-[120%] h-[120%] bg-[conic-gradient(at_bottom_left,_#ff0055,_#ffcc00,_#00ffff,_#ff00ff)] animate-[spin_18s_linear_infinite] opacity-10 blur-3xl"></div>
      </div>

      <motion.div
        className="relative z-10 w-full max-w-2xl glass rounded-3xl p-10 shadow-[0_0_60px_rgba(255,0,100,0.2)]"
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7 }}
      >
        <motion.header
          className="text-center mb-10"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.3 }}
        >
          <h1 className="text-6xl font-extrabold mb-2 bg-gradient-to-r from-red-500 via-pink-500 to-purple-500 bg-clip-text text-transparent animate-pulse">
            üé¨ MeTube
          </h1>
          <p className="text-gray-400 font-medium text-sm">
            Download YouTube videos in ultra quality
          </p>
        </motion.header>

        <motion.main
          className="flex flex-col gap-6"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5 }}
        >
          <label className="text-sm text-gray-300 font-semibold tracking-wide uppercase">
            YouTube URL
          </label>
          <input
            type="text"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="https://www.youtube.com/watch?v=..."
            disabled={loading}
            className="glass-input rounded-xl px-5 py-4 w-full bg-black/40 border border-gray-700 focus:border-red-500 focus:ring-2 focus:ring-red-500 outline-none text-gray-100 font-medium placeholder-gray-500 transition-all duration-200"
          />

          <div className="flex flex-col sm:flex-row gap-4 mt-4">
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.97 }}
              disabled={loading}
              onClick={handleDownload}
              className={`relative flex-1 text-lg py-4 rounded-xl font-semibold transition-all overflow-hidden group ${
                loading
                  ? "bg-gray-700 cursor-not-allowed"
                  : "bg-gradient-to-r from-pink-600 to-red-600 hover:from-red-500 hover:to-pink-600"
              }`}
            >
              {loading ? (
                <div className="flex items-center justify-center gap-2 text-white">
                  <span className="loader h-5 w-5 border-4 border-white border-t-transparent rounded-full animate-spin"></span>
                  Downloading...
                </div>
              ) : (
                <span className="relative z-10 text-white">
                  ‚¨áÔ∏è Download Highest Quality
                </span>
              )}
              {!loading && (
                <span className="absolute inset-0 bg-gradient-to-r from-transparent via-white/10 to-transparent translate-x-[-200%] group-hover:translate-x-[200%] transition-transform duration-700 ease-out"></span>
              )}
            </motion.button>

            <button
              type="button"
              disabled={loading}
              onClick={() => {
                setUrl("");
                setMsg("");
              }}
              className="rounded-xl border border-gray-600 text-gray-300 hover:text-white hover:border-red-500 transition-all duration-200 px-6 py-4"
            >
              Clear
            </button>
          </div>

          {msg && (
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              className={`mt-4 p-4 rounded-xl text-sm font-medium text-center ${
                msg.includes("‚úîÔ∏è")
                  ? "bg-green-500/20 text-green-400 border border-green-600/40"
                  : msg.includes("failed")
                  ? "bg-red-500/20 text-red-400 border border-red-600/40"
                  : "bg-blue-500/20 text-blue-400 border border-blue-600/40"
              }`}
            >
              {msg}
            </motion.div>
          )}
        </motion.main>

        <motion.footer
          className="mt-10 text-center text-gray-500 text-xs"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.8 }}
        >
          Built with ‚ù§Ô∏è using React, TailwindCSS & Spring Boot
        </motion.footer>
      </motion.div>
    </div>
  );
}
